import axios from 'axios';
import React, { useEffect, useState } from 'react';
import employeeService from '../services/employee.service';
import { useLocation } from 'react-router-dom';


function ParentUpdate() {
  var  [parentAll, setParentAll] = useState([]);
  const location = useLocation();
  const searchParams = new URLSearchParams(location.search);
  const id = searchParams.get('id');

    var [formData, setFormData] = useState({
        email: '',
        password: '',
        dob: '',
        gender: '',
        address: '',
        mobileNo: '',
        parentId: '',
        pfirstName: '',
        plastName: ''
      });


      useEffect(() => {
        fetchData();
      }, []);



      const fetchData = async () => {

        try {

          const response = await employeeService.viewAllParent();
          parentAll = response.data;
          setParentAll([...parentAll]);
          console.log(parentAll);
          var selectedParent = parentAll.find(parent => parent.parentId === parseInt(id));

          formData = selectedParent;

          setFormData({...formData});
            console.log("form data"+formData);

        } catch (error) {
          console.log('Something went wrong', error);
        }

      };


      var handleInputChange=(event)=>{
        const { name, value } = event.target;
        setFormData(prevData => ({
          ...prevData,
          [name]: value
        }));
        //   var copyOfParent = {...formData};
      //   copyOfParent[args.target.name] = 
      //               args.target.value;

      //               console.log(copyOfParent.name+" ...");
      //   var c={...copyOfParent};
      //  setFormData({...copyOfParent});
    }


      const handleSubmit = async (event) => {
        event.preventDefault();

        try {
          const response = await axios.put('YOUR_UPDATE_ENDPOINT', formData);
          console.log('Data updated:', response.data);
          // Perform any further actions, e.g., show success message, navigate back, etc.
        } catch (error) {
          console.error('Error updating data:', error);
        }
      };


    return (
        <div className="container mt-5">
          <h1>Parent Registration Form</h1>
          <form>
            <div className="row">
              <div className="col-md-6">
                <label>Email</label>
                <input type="email" className="form-control" onChange={handleInputChange} name="email" value={formData.email} />
              </div>
              <div className="col-md-6">
                <label>Password</label>
                <input type="text" className="form-control" onChange={handleInputChange} name="password" value={formData.password}/>
              </div>
            </div>
            <div className="row">
              <div className="col-md-6">
                <label>Date of Birth</label>
                <input type="date" className="form-control" onChange={handleInputChange} name="dob" value={formData.dob}/>
              </div>
              <div className="col-md-6">
                <label>Gender</label>
                <select className="form-control" onChange={handleInputChange} name="gender" value={formData.gender}>
                  <option>Male</option>
                  <option>Female</option>
                </select>
              </div>
            </div>
            <div className="row">
              <div className="col-md-12">
                <label>Address</label>
                <textarea className="form-control"  onChange={handleInputChange} name="address" value={formData.address} rows="3"></textarea>
              </div>
            </div>
            <div className="row">
              <div className="col-md-6">
                <label>Mobile Number</label>
                <input type="tel" className="form-control" onChange={handleInputChange}  value={formData.mobileNo} />
              </div>
              <div className="col-md-6">
                <label>Parent ID</label>
                <input type="number" className="form-control"  onChange={handleInputChange}  value={formData.parentId}/>
              </div>
            </div>
            <div className="row">
              <div className="col-md-6">
                <label>First Name</label>
                <input type="text" className="form-control" onChange={handleInputChange}  value={formData.pfirstName} />
              </div>
              <div className="col-md-6">
                <label>Last Name</label>
                <input type="text" className="form-control" onChange={handleInputChange}  value={formData.plastName

                }/>
              </div>
            </div>
            <div className="mt-3">
              <button type="submit" className="btn btn-primary">
                Register
              </button>
            </div>
          </form>
        </div>
      );
}



export default ParentUpdate;
